void BNN::SetNetRange(UInt_t netBegin_, UInt_t netEnd_)
{
	netBegin = netBegin_;
	netEnd = std::min(netEnd_, UInt_t(50));
}


Double_t BNN::operator()(Double_t const *vars) const
{
	return Apply(vars);
}


Double_t BNN::operator()(Double_t var0, Double_t var1, Double_t var2, Double_t var3, Double_t var4, Double_t var5, Double_t var6, Double_t var7, Double_t var8, Double_t var9) const
{
	Double_t vars[10];
	
	vars[0] = var0;
	vars[1] = var1;
	vars[2] = var2;
	vars[3] = var3;
	vars[4] = var4;
	vars[5] = var5;
	vars[6] = var6;
	vars[7] = var7;
	vars[8] = var8;
	vars[9] = var9;
	return Apply(vars);
}


Double_t BNN::Apply(Double_t const *vars) const
{
	Double_t transVars[10];
	std::copy(vars, vars + 10, transVars);
	
	trans0(transVars);
	
	Double_t res = 0.;
	
	for (unsigned n = netBegin; n < netEnd; ++n)
		res += *nets[n].Apply(transVars);
	
	return res / (netEnd - netBegin);
}


